import React, { useState } from 'react';
import Krangeslider from './rangeslider';

function KrangesliderLadder () {

  const [ value, setValue ] = useState(50);

  return (
    <div class='inlined'>
      <span>Green Pepper</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <span/>
      <span/>
      <span/>
      <span>Green Pepper</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <span/>
      <span/>
      <span/>
      <span>Green Pepper</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <span/>
      <span/>
      <span/>
      <span>Green Pepper</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <span/>
      <span/>
      <span/>
      <span>Green Pepper</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <span/>
      <span/>
      <span/>
      <span>Green Pepper</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <span/>
      <span/>
      <span/>
    </div>

  );

};

export default KrangesliderLadder;
